@Tankarchist The performatively loud ones don't scare me. It's the ones who play along for a little while.

The loud ones make a fuss and get carried out by security.

The quiet ones get on the plane knowing/suspecting that they're positive and THEN take off their mask when no ones looking.

@LustrousLynx @lacadri34 The answer is simple.

If you don't want to wear a mask, don't get on a plane.

No one is "forcing" you to wear a mask.
